import React from 'react';
import {BrowserRouter as Router, Link, Route, Routes} from 'react-router-dom';
import Promo from './Promo';

const Header = () => {
    return (
        <div className="container-fluid">
            <div className="row">
                <div className="col-xl-12" style={{backgroundColor: '#355C7D'}}>
                    <div className="row">
                        <div className="offset-xl-3 col-xl-2 col-3 text-start">
                            <h1 style={{color: 'white'}}>HOME</h1>
                        </div>
                        <div className="col-xl-3 col-10 text-xl-start">
                            <h1 style={{color: 'white'}}>ADD AN ARTICLE</h1>
                        </div>
                        <div className="col-xl-3 col-10 text-xl-start">
                            <h1 style={{color: 'white'}}>PERSONAL AREA</h1>
                        </div>
                        <Link to="/promo">Другая страница</Link>
                        <Router>
                            <Routes>
                                <Route path="/" element={<Promo />} />
                                {/* Другие маршруты */}
                            </Routes>
                        </Router>
                    </div>

                </div>
            </div>
        </div>
    );
};

export default Header;
